import axios from "axios"


const Status = () => {

    const [status, setStatus] = useState(null)

    const apiEndPoint = "http://localhost:3000/status"
    useEffect(() => {
        const getStatus = async () => {
            const data = await axios.get(apiEndPoint).then((res) => {
                setStatus(res)
            })
            getStatus()
        }
    }, [])
    return (
        <>
            <h1> from status section </h1>
            <h2> {status.length } </h2>
             <table className="table">
                <thead>
                    <tr>
                        <th> first_name </th>
                        <th> last_name </th>
                        <th> status </th>
                    </tr>
                </thead>
                <tbody>
                    {postMessage.map()}
                </tbody>
             </table>
        </>
    )
}

export default Status
